import React, { Component, Fragment } from 'react';
import { MenuBar, MenuItem } from './About.styled.js';

class About extends Component {
  constructor(props){
    super(props);
    this.state={};
  }

  render() {
    return (
      <Fragment>
        <MenuBar>
          <MenuItem>About Wren</MenuItem>
          <MenuItem>Coaching History</MenuItem>
          <MenuItem>Coaching Style</MenuItem>
        </MenuBar>
      </Fragment>
    );
  }
}

export default About;
